  self.updateMessageFailed = function(cause){
    self.messageFailed = require('../../js/config.js').messageFailed.replace('{0}', cause);
  };

  self.updateHasMessage = function(value, name){
    self[utils.camelize('has '+name)] = !!value;
  };

